class MyFavorytes extends Component {
    constructor(props){
      super(props);
    }
        render() {
            return (
                <div>
                    {this.props.name.map(item =>{
                        return(
                            <div>
                            <p>{item}</p>
                            </div>
                        )
                    }

                    )}
                </div>
            )
        }
}
export default MyFavorytes;
